import {
    BUTTON_BLOCK_COMPLETED,

} from "./types";

export const changeFlagButtonClick = (stateLevelFinal, letter, numberLevelBlock) => {
    //клик по кнопке со слогом помечает как true
    let arr = stateLevelFinal[letter];
    arr[numberLevelBlock]= true;

    return {
        type: BUTTON_BLOCK_COMPLETED,
        payload: arr
    }
}
